// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DecentralizedRideSharing {
    struct Ride {
        address rider;
        address driver;
        uint256 price;
        string pickupLocation;
        string dropLocation;
        bool isCompleted;
    }

    mapping(string => Ride) public rides;
    string[] public availableRides;

    // Create a new ride (Rider function)
    function createRide(
        string memory _rideCode,
        uint256 _price,
        string memory _pickupLocation,
        string memory _dropLocation
    ) public payable {
        require(bytes(_rideCode).length > 0, "Ride code is required");
        require(msg.value == _price, "Price must be paid upfront");
        require(rides[_rideCode].rider == address(0), "Ride code already exists");

        rides[_rideCode] = Ride({
            rider: msg.sender,
            driver: address(0),
            price: _price,
            pickupLocation: _pickupLocation,
            dropLocation: _dropLocation,
            isCompleted: false
        });

        availableRides.push(_rideCode);
    }

    // Accept a ride (Driver function)
    function acceptRide(string memory _rideCode) public {
        require(bytes(_rideCode).length > 0, "Ride code is required");
        require(rides[_rideCode].rider != address(0), "Ride does not exist");
        require(rides[_rideCode].driver == address(0), "Ride already accepted");
        require(rides[_rideCode].rider != msg.sender, "Rider and driver cannot be the same");

        rides[_rideCode].driver = msg.sender;
    }

    // Complete a ride (Rider function)
    function completeRide(string memory _rideCode) public {
        require(bytes(_rideCode).length > 0, "Ride code is required");
        require(rides[_rideCode].rider == msg.sender, "Only the rider can complete this ride");
        require(rides[_rideCode].isCompleted == false, "Ride is already completed");

        rides[_rideCode].isCompleted = true;
    }

    // Get available rides
    function getAvailableRides() public view returns (Ride[] memory) {
        Ride[] memory details = new Ride[](availableRides.length);
        for (uint256 i = 0; i < availableRides.length; i++) {
            details[i] = rides[availableRides[i]];
        }
        return details;
    }
}
